exports=async function(bid,options){const{parseCatalogPaginate,getSelectLastOptionSubRegex}=await require("transcode/parse_catalog"),clientOptions={...(options&&options.clientOptions)};return parseCatalogPaginate(page=>`http://www.108shu.com/book/${bid}/${1===page?"":"index_"+page+".html"}`,".section-list",{...options,clientOptions,pageSize:20,totalPagesRegex:html=>getSelectLastOptionSubRegex(html,/\/index_(\d+)\.html/)?.intValue()})};